import React from 'react';
import userService from './userService';

const myWord = ()=>{
class UserComponent extends React.Component {

    constructor(props){
        super(props);
        this.state = {
            users:[]
        }
    }

    componentDidMount(){
        userService().then((response)=>{
             this.setState = response.data;
        })
    }

    render(){
        return (
            
            <div className='user'>

            <thead>
                 <tr>
                    <td>
                        email_id
                    </td>
                    <td>
                        password
                    </td>
                 </tr>
            </thead>

            <tbody>
                {
                    this.state.users.map(
                        user => 
                            <tr key={user.email_id}>
                              <td>
                                    {user.email_id}
                              </td>
                              <td>
                                    {user.password}
                              </td>
                            </tr>
                    )
                }
            </tbody>
            
        </div>

        )
    }
}
}

export default UserComponent;
